import './App.css';
import axios from 'axios';
import {useEffect, useState} from 'react';

function App() {
  const [datas,setDatas] = useState(null);
  useEffect( ()=> {
    axios.get("http://20.244.56.144/test/companies")
    .then((res) => {
      setDatas(res.data);
      console.log(res.data);
    })
  },[])
  return (
    <div className="App">
        {
          (datas) ? 
         (
          datas.map(data => {
            return(
              <div key={data.id}>
            <h3 >
                {data.title}
            </h3>
            <p style={{marginTop:'10px',color:'blue'}}>
              {data.body}
            </p>
            </div>
          )})
        )  
          :
          <p>Loading....</p>
        }


    </div>
  );
}

export default App;
